import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/TicketCard.css';

const TicketCard = ({ ticket }) => {
  const getStatusClass = (status) => {
    switch (status) {
      case 'open': return 'status-open';
      case 'in-progress': return 'status-in-progress';
      case 'resolved': return 'status-resolved';
      case 'closed': return 'status-closed';
      default: return '';
    }
  };

  const getUrgencyClass = (urgency) => {
    switch (urgency) {
      case 'low': return 'urgency-low';
      case 'medium': return 'urgency-medium';
      case 'high': return 'urgency-high';
      case 'critical': return 'urgency-critical';
      default: return '';
    }
  };

  return (
    <div className="ticket-card">
      <div className="ticket-header">
        <h3 className="ticket-title">
          <Link to={`/tickets/${ticket._id}`}>{ticket.title}</Link>
        </h3>
        <div className="ticket-meta">
          <span className={`status-badge ${getStatusClass(ticket.status)}`}>
            {ticket.status}
          </span>
          <span className={`urgency-badge ${getUrgencyClass(ticket.urgency)}`}>
            {ticket.urgency}
          </span>
        </div>
      </div>
      
      <div className="ticket-body">
        <p className="ticket-description">{ticket.description}</p>
        <div className="ticket-info">
          <span>Type: {ticket.issueType}</span>
          <span>ID: {ticket.ticketId}</span>
          <span>Created: {new Date(ticket.createdAt).toLocaleDateString()}</span>
        </div>
      </div>
      
      <div className="ticket-footer">
        <div className="ticket-assignment">
          {ticket.assignedTo ? (
            <span>Assigned to: {ticket.assignedTo.username}</span>
          ) : (
            <span>Unassigned</span>
          )}
        </div>
        <Link to={`/tickets/${ticket._id}`} className="view-details-btn">
          View Details
        </Link>
      </div>
    </div>
  );
};

export default TicketCard;
